import React from 'react';

function Login() {
    return (
        <div>
            <div className="container">
                <div className="row">
                    <div className="col-md-6 col-md-offset-3">
                        <h2>User Login</h2>
                        <form className="login">
                            <div className="form-group"></div>
                        </form>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Login;
